import React from 'react';

const ToDoList = (props) =>{
    const sidebar = sidebar.length ? (
        <ul>
            {props.posts.map((post) =>
            <li key={post.id}>
                <input  type='checkbox' id={post.id}/>
                <label htmlFor={post.id}> {post.title}</label>
            </li>
            )}
        </ul>
    ): (<p>Нет задача</p>);
    return (
        <div className='list'>
            {sidebar}
        </div>
    )
}

export default ToDoList;
